import React, {Component} from "react";
import "../css/newPayment.css";

export default class NewPayment extends Component {

// Konstruktor /////////////////////////////////////////////////////////////////////

// Získání dat ////////////////////////////////////////////////////////////////////

    componentDidMount() {
        document.title = "Nová platba | Web Bank";
    }

// Vykreslení /////////////////////////////////////////////////////////////////////

    render() {

        return(
            <div id="newPaymentContainer">

                <h1>Nová platba</h1>

                <div id="newPayment">
                    <table>
                        <tbody>
                            <tr>
                                <td>
                                    <div>Název platba:</div>
                                </td>

                                <td>
                                    <input type="" />
                                </td>
                            </tr>
                        </tbody>
                    </table>
                </div>
            </div>
        )
    }
}
